import React from "react";
import { addToCart } from "../Carrito"

export const ObjectProducto = (
    { id,
        name,
        picture,
        price,
        stock,
        id_category
    }) => {
    return (
        <div>
            <div>
                <h1>{name}</h1>
            </div>

            <img class="imagen" src={picture} alt={name} />
            {price}
            {stock}
            <button onClick={() => addToCart(id)}>
                Agregar
            </button>
        </div>

    )
}
